def all_bssids():
    bssids = {}

    for sample in SAMPLES:
        for index in sample['Readings']:
            bssid = sample['Readings'][index]['BSSID']
            if bssid in bssids:
                bssids[bssid]+=1
            else:
                bssids[bssid]=1

    return bssids

def get_cluster(bssid):
    return bssid[:-3]

def bssid_clusters_in_AB():
    distinct_clusters = {}
    for sample in SAMPLES:
        if (sample['Location']['Building'] == "Academic"):
            for index in sample['Readings']:
                bssid = sample['Readings'][index]['BSSID']
                bssid_cluster = get_cluster(bssid)

                if bssid_cluster in distinct_clusters:
                    distinct_clusters[bssid_cluster] += 1
                else:
                    distinct_clusters[bssid_cluster] = 1
    return distinct_clusters

def generate_new_clustered_file():
    f = open('/home/prateek/Desktop/ClusteredReadings.txt', 'w')

    for sample in SAMPLES:
        a = {}
        a['Readings'] = {}
        a['Location'] = sample['Location']

        if sample['Location']['Building'] == 'Academic':
            for index in sample['Readings']:
                cluster_bssid = get_cluster(sample['Readings'][index]["BSSID"])
                if cluster_bssid not in a['Readings']:
                    a['Readings'][cluster_bssid] = [int(sample['Readings'][index]['Strength']),1]
                else:
                    a['Readings'][cluster_bssid][0] += int(sample['Readings'][index]['Strength'])
                    a['Readings'][cluster_bssid][1] += 1

            for cluster_bssid in a['Readings']:
                a['Readings'][cluster_bssid] = a['Readings'][cluster_bssid][0] / a['Readings'][cluster_bssid][1];
            json.dump(a, f)
            f.write("\n")

    f.close()

def get_location_tag(location):
    return location['Building'] + location['Floor'] + location['ID']

def generate_location_wise_file():
    a = {}
    for sample in Clustered_Samples:
        location = get_location_tag(sample['Location'])

        if location not in a:
            a[location] = {}
            for bssid_cluster in access_points_academic:
                a[location][bssid_cluster] = [0,0]

        for reading in sample['Readings']:
            a[location][reading][0]+=int(sample['Readings'][reading])
            a[location][reading][1]+=1

    for location in a:
        for access_point in a[location]:
            if (a[location][access_point][1]==0):
                a[location][access_point]=-99
            else:
                a[location][access_point]= a[location][access_point][0] / a[location][access_point][1]

    f = open('/home/prateek/Desktop/LocationMeanFile.txt','w')
    json.dump(a,f)


